import { Link } from "react-router-dom";

export const NavigationAsFC : React.FC =() =>{

    return (

      <div className="navigation"  >
 <ul>
<li> <Link to="/">Home </Link></li>
<li> <Link to="/books">Books </Link></li>

 </ul>
 </div>
    )
}
